Y’all know how I love talking about portfolios, right? Well guess what? I’m going to be a guest artist in the Powerful Portfolios Workshop, a 3-day live event packed with professional artists sharing their knowledge about portfolios and licensing! Join me at the workshop to hear inspiring presentations and behind-the-scenes peeks from Cat Coquillette, Amarilys Henderson, Shannon McNab, Peggy Dean, Tara Reed, Lissie Teehee, Jess Miller and hosts Maja Faber and Liz Kohler Brown. 

Register before January 9th to lock in the early bird pricing! See you there? Link in my bio.

